Here is a function in JavaScript that takes an array of 5 numbers as input and checks if any of the numbers is a valid prime number, and if it is, prints the number to the console:

```javascript
function checkPrime(numbers) {
 for (let i = 0; i < numbers.length; i++) {
 let number = numbers[i];
 if (number > 1) {
 for (let j = 2; j <= Math.sqrt(number); j++) {
 if (number % j === 0) {
 break;
 }
 }
 if (number === j) {
 console.log(number);
 }
 }
 }
}

// Example usage:
let numbers = [17, 22, 19, 23, 31];
checkPrime(numbers); // Output: 17, 19, 23
```

This function uses a nested loop to check if a number is prime by testing if it is divisible by any number from 2 to its square root. If the number is not divisible by any of these numbers, it is considered prime and is printed to the console.

Para crear un bucle `for` en Java, puedes usar la siguiente sintaxis:

```
for (inicialización; condición; incremento) {
    // Código a ejecutar en cada iteración
}
```

Donde:

* `inicialización` es una instrucción que se ejecuta una sola vez al inicio del bucle, para inicializar la variable de control.
* `condición` es una expresión que se evalúa antes de cada iteración del bucle. Si la condición es verdadera, el bucle continúa. Si es falsa, el bucle termina.
* `incremento` es una instrucción que se ejecuta al final de cada iteración del bucle, para actualizar la variable de control.

Aquí hay un ejemplo de cómo usar un bucle `for` en Java para imprimir los números del 1 al 10:

```
for (int i = 1; i <= 10; i++) {
    System.out.println(i);
}
```

También puedes usar un bucle `for` para recorrer un arreglo:

```
int[] numbers = {1, 2, 3, 4, 5};
for (int i = 0; i < numbers.length; i++) {
    System.out.println(numbers[i]);
}
```
